			arsVO.setA7(!StringUtil.isEquals(subjectAnswer[6], "x")?subjectAnswer[6]:score[6]);                           
			arsVO.setA8(!StringUtil.isEquals(subjectAnswer[7], "x")?subjectAnswer[7]:score[7]);                           
			arsVO.setA9(!StringUtil.isEquals(subjectAnswer[8], "x")?subjectAnswer[8]:score[8]);                           
			arsVO.setA10(!StringUtil.isEquals(subjectAnswer[9], "x")?subjectAnswer[9]:score[9]);                          
