	@Override
	public List<SurveyTotalVO> selectSurveyTotalList(SurveyTotalVO surveyTotalVO) {
		List<SurveyTotalVO> result = surveyDAO.selectSurveyTotalList(surveyTotalVO);
//		String docIdt = surveyTotalVO.getDocId();
		List<SurveyTotalVO> totalListVO = new ArrayList<SurveyTotalVO>();
		SurveyTotalVO totalVO;
		
		for(SurveyTotalVO vo : result) {
		totalVO = new SurveyTotalVO();
		totalVO.setTargetId(vo.getTargetId()); 
		totalVO.setTargetDisId(vo.getTargetDisId());
		totalVO.setSex(vo.getSex());                                                                                                                        
		totalVO.setProtocol(vo.getProtocol());                                                                                                              
		totalVO.setPerformCnt(vo.getPerformCnt());    
		totalVO.setPerformNm(vo.getPerformNm());   
		totalVO.setAge(vo.getAge());                                                                                                                        
		totalVO.setVisitDate(vo.getVisitDate());
		totalVO.setCvCgis(vo.getCvCgis());
		totalVO.setCvCgii(vo.getCvCgii());
		totalVO.setCvCgas(vo.getCvCgas());
		totalVO.setIv4Cgis(vo.getIv4Cgis());
		totalVO.setIv4Cgii(vo.getIv4Cgii());
		totalVO.setIv4Cgas(vo.getIv4Cgas());
		
		totalVO.setArs01(vo.getArs01());
		totalVO.setKcbcl(vo.getKcbcl());
		totalVO.setCbcl1(vo.getCbcl1());
		totalVO.setDbds1(vo.getDbds1());
		totalVO.setCmrsp(vo.getCmrsp());
		totalVO.setTraum(vo.getTraum());
		totalVO.setCdi01(vo.getCdi01());
		totalVO.setIat01(vo.getIat01());
		totalVO.setKscal(vo.getKscal());
		totalVO.setRcmas(vo.getRcmas());
		totalVO.setStitc(vo.getStitc());
		totalVO.setStisc(vo.getStisc());
		totalVO.setStity(vo.getStity());
		totalVO.setStisy(vo.getStisy());
		totalVO.setLoicv(vo.getLoicv());
		totalVO.setKbis1(vo.getKbis1());
		totalVO.setBdi01(vo.getBdi01());
		totalVO.setStitp(vo.getStitp());
		totalVO.setStisp(vo.getStisp());
		totalVO.setMbri1(vo.getMbri1());
		totalVO.setKadhd(vo.getKadhd());
		totalVO.setKpsi1(vo.getKpsi1());
		totalVO.setSrs01(vo.getSrs01());
		totalVO.setSrs02(vo.getSrs02());
		totalVO.setYgts1(vo.getYgts1());
		totalVO.setYgts2(vo.getYgts2());
		totalVO.setCybo2(vo.getCybo2());
		totalVO.setCybo3(vo.getCybo3());
		totalVO.setYbocs(vo.getYbocs());
		totalVO.setYboca(vo.getYboca());
		
		
		String totalUsed = vo.getPillCntUsed();
//		String performNm = vo.getPerformNm();
//		String docIdt = vo.getDocId();	
		
		
		String pillCount;

		if(!totalUsed.equals("x") || !totalUsed.equals("0") || !totalUsed.equals("")) {
		try {
			int pillUsed = (Integer.parseInt(vo.getPillCntUsed()));
			int pillEaten = (Integer.parseInt(vo.getPillCntEaten()));
			
			if(pillUsed <= 0 || pillEaten < 0 || pillUsed < pillEaten) {
				totalVO.setPillCount("x");
			}else {

			//복용률
			int pillCntPercent = pillEaten*100 / pillUsed;
			String pill = String.valueOf(pillCntPercent);

			String pillCntKind = vo.getPillCntKind();
			String pillCntTotal = vo.getPillCntTotal();

			pillCount = pillCntKind + " - " + pillCntTotal + "mg - " + pill + "%";
			totalVO.setPillCount(pillCount);
			}
		} catch (NumberFormatException e) {
			totalVO.setPillCount("x");
		}
		}else {
		totalVO.setPillCount("x");
		}
		
		totalListVO.add(totalVO);
		}
		return totalListVO;
	}

